import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';

@NgModule({
  declarations: [
    AppComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }

import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

const routes: Routes = [
  {
    path: 'report',
    loadChildren: () => "import('./customize-report/customize-report.module').then(m => m.CustomizeReportModule)"
  },
  {
    path: '',
    redirectTo: 'report',
    pathMatch: 'full'
  }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }

import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { CustomizeReportRoutingModule } from './customize-report-routing.module';
import { ReportListComponent } from './report-list/report-list.component';
import { AccountDetailsComponent } from './account-details/account-details.component';
import { ReportAnalysisComponent } from './report-analysis/report-analysis.component';
import { ReportComponent } from './report/report.component';
import { HeadingComponent } from './heading/heading.component';


@NgModule({
  declarations: [
    ReportListComponent,
    AccountDetailsComponent,
    ReportAnalysisComponent,
    ReportComponent,
    HeadingComponent
  ],
  imports: [
    CommonModule,
    CustomizeReportRoutingModule
  ]
})
export class CustomizeReportModule { }

import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { ReportListComponent } from './report-list/report-list.component';
import { ReportComponent } from './report/report.component';

const routes: Routes = [
  {
    path: '',
    component: ReportComponent
  },
  {
    path: 'reportlist',
    component: ReportListComponent
  }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class CustomizeReportRoutingModule { }
